  false,\n\t\"url\": null,\n\t\"notes\": \"This Annual Narrative Report for the Matagorda
  Island Unit of Aransas National Wildlife Refuge summarizes refuge activities during
  1989.  The report begins with information about the yearu2019s highlights and climatic
  conditions.   Land acquisition- including fee title and easements- is also covered.
  \ The report includes a planning section which discusses the management plan, public
  participation, and research/investigations.  Refuge administration is outlined;
  lists of personnel, youth programs, and volunteer programs are given.  Habitat management
  is also covered.  Subjects include general habitats, wetlands, grasslands, grazing,
  and fire management.  The wildlife section of the report discusses wildlife diversity,
  endangered/threatened species, waterfowl, marsh/water birds, shorebirds, raptors,
  game animals, marine mammals, and fisheries.  The public uses of the refuge described
  in this report include general use, outdoor classrooms, interpretive foot trails,
  tours, hunting, fishing, and wildlife observation.  The equipment and facilities
  section of the report provides information about major maintenance, communication
  systems, and computer systems.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
